import { useState } from "react";
import React from "react";



function Hum() {
    const [tasks, setTasks] = useState(tasks1);

    const changeStatus = (index) => {

        let newTasks = tasks;
        console.log("OLD", newTasks);
        newTasks[index].status = !newTasks[index].status;
        console.log("NEW", newTasks);
        setTasks(newTasks)
    }

    return (
        <div>


            <h3>Status:</h3>

            <ul>
                {tasks.map((item, index) => {
                    return (
                        <li style={{ textDecoration: (item.status ? "line-through" : "") }} onClick={() => { changeStatus(index) }}>
                            {item.id} - {item.title}
                        </li>
                    );
                })}
            </ul>
        </div>
    );
}
export default Hum;
